import React from 'react';
import './style.css';

function SignUpBtns () {
    return (
        <div className="main-buttons">
            <button variant="primary" size="lg">
                Log In
            </button>
            <button variant="secondary" size="lg">
                Sign-Up
            </button>
        </div>

    )
}

export default SignUpBtns;
